import React, { Component } from 'react';
import Reactotron from 'reactotron-react-js';


class ShiftDetails extends Component {

    listData = (props) => {
        return props.map((item) => {
            return( 
                <div key={item.number}>
                    <ul>
                        <li>number: {item.number}</li>
                        <li>startTime: {item.startTime}</li>
                        <li>endTime: {item.endTime}</li>
                        <li>temperature: {item.temperature}</li>
                        <li>wind Speed: {item.windSpeed}</li>
                        <li><img src={item.icon}></img></li>
                        <li>detailedForecast: {item.detailedForecast}</li>
                    </ul>
                </div>
            )
        })
    }

    render(){
        Reactotron.log('this.props', this.props)
        console.log('this.props', this.props)
        const { weatherData } = this.props;
        return (
        <div>
            {this.listData(weatherData)}
        </div>
        )
    }
}

export default ShiftDetails;
